import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Box, Grid, Paper, Typography, Button } from '@mui/material';
import { Bar } from 'react-chartjs-2';

function Dashboard() {
  const [commissionData, setCommissionData] = useState(null);
  const [violationsData, setViolationsData] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    if (!userEmail) {
      navigate('/');
      return;
    }

    const fetchData = async () => {
      const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${userEmail}`);
      const result = await response.json();
      if (result.success) {
        setCommissionData(result.commissionData);
        setViolationsData(result.violationsData);
      } else {
        alert("Failed to fetch data");
      }
    };

    fetchData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    navigate('/');
  };

  if (!commissionData) return <div>Loading...</div>;

  const agentFirstName = commissionData.agentname ? commissionData.agentname.split(" ")[0] : "Agent";

  // Example chart data (replace with real history later)
  const commissionChartData = {
    labels: ['Week 1', 'Week 2', 'Week 3', 'Week 4'],
    datasets: [
      {
        label: 'Commission ($)',
        data: [500, 750, 300, 900],
        backgroundColor: 'rgba(211, 47, 47, 0.7)',
      },
    ],
  };

  const chartOptions = {
    responsive: true,
    plugins: {
      legend: { display: false },
      title: { display: true, text: 'Weekly Commission Trend' },
    },
    scales: { y: { beginAtZero: true } },
  };

  return (
    <Box sx={{ flexGrow: 1, p: 2, backgroundColor: "#f5f5f5", minHeight: "100vh" }}>
      {/* üî¥ Fiesta Header */}
      <Grid container spacing={2} alignItems="center" sx={{ mb: 2 }}>
        <Grid item xs={6} sx={{ display: "flex", alignItems: "center" }}>
          <img src="/fiesta-logo.png" alt="Fiesta Logo" style={{ height: "40px", marginRight: "10px" }} />
          <Typography variant="h5">Welcome, {agentFirstName}</Typography>
        </Grid>
        <Grid item xs={6} sx={{ textAlign: "right" }}>
          <Button variant="contained" color="error" onClick={handleLogout}>
            Logout
          </Button>
        </Grid>
      </Grid>

      {/* üìù Dashboard Content */}
      <Grid container spacing={2}>
        {/* Card 1: Weekly Commission Summary */}
        <Grid item xs={12} md={4}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6">Weekly Commission</Typography>
            <Typography variant="body1" sx={{ fontWeight: "bold", mt: 1 }}>
              {commissionData.commissionafterarfeescanningviolations || "N/A"}
            </Typography>
          </Paper>
        </Grid>

        {/* Card 2: Commission Chart */}
        <Grid item xs={12} md={8}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6">Commission History</Typography>
            <Bar data={commissionChartData} options={chartOptions} />
          </Paper>
        </Grid>

        {/* Card 3: Expenses Summary */}
        <Grid item xs={12} md={4}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6">Expenses</Typography>
            <Typography variant="body2">Gross Pay: {commissionData.grosspay || "N/A"}</Typography>
            <Typography variant="body2">NB Corp Fees: {commissionData.nbcorffee || "N/A"}</Typography>
            <Typography variant="body2">Endo Corp Fees: {commissionData.encorpfee || "N/A"}</Typography>
            <Typography variant="body2">Referrals/Pay Out: {commissionData.refferalspayout || "N/A"}</Typography>
          </Paper>
        </Grid>

        {/* Card 4: Violations */}
        <Grid item xs={12} md={8}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6">Violations Summary</Typography>
            {violationsData && violationsData.length > 0 ? (
              violationsData.map((violation, index) => (
                <Box key={index} sx={{ mb: 1 }}>
                  {Object.entries(violation).map(([key, value]) => (
                    <Typography key={key} variant="body2">
                      <strong>{key}:</strong> {value || "N/A"}
                    </Typography>
                  ))}
                </Box>
              ))
            ) : (
              <Typography variant="body2">No violations found.</Typography>
            )}
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
}

export default Dashboard;
